[INFO] 2021-05-16 12:27:02.319 com.alibaba.druid.pool.DruidDataSource:[1928] - {dataSource-1} closed
2. The environment is single node dolphinscheduler service;
**How should we solve this problem？**

@ruanwenjun 
Can I solve this problem by backing back the dolphinscheduler version ?
Now is dolphin1.3.6 ,I need dolphin version greater than dolphin1.3.5 for adapt to flink1.11

@cpbeast  Can you describe your operation and provide the error log? I think this can work well with MySQL 8.0. 
I have tested on MySQL 8.0.22, it will print a warning log, this is caused by ssl, if you also meet this problem, you can try to set  `useSSL=false`
https://github.com/apache/dolphinscheduler/blob/bc22ae7c91c9cbd7c971796ba3a45358c2f11864/dolphinscheduler-common/src/main/java/org/apache/dolphinscheduler/common/datasource/mysql/MysqlDatasourceProcessor.java#L54

@lishiyucn I have submitted a pr #5497, you can help me review. 
And furthermore, you need to find out why the instance crashed. I can help you check, but you need to provide more log information. 
I guess it may be due to the fluctuation of the zookeeper connection, because currently, the zookeeper connection reconnect will cause instance crashed. #5211

@cpbeast I think you need to download the connector lib
![image](https://user-images.githubusercontent.com/22415594/118758776-42cee480-b8a2-11eb-8793-536547fb1c5e.png)

Of course, you can choose a higher version of the connector, but what I want to say is that the current version can also work. It may be a good idea to provide version options when adding data sources, because sometimes different versions of Driver may not be compatible.

@wangxj3 Yeal, I also noticed this problem, this caused by each instance will listen the node path in zookeeper. 
~~One possible solution is to get the lock on zookeeper when insert the instance crash alert.~~
Can we think each instance should save at most one unsent instance alert in database?
